const About = () => {
  return (
    <div className="about">
      <p>Name : Trần Hữu Toàn</p>
      <p>Date of birth : 18/04/2002</p>
      <p>Contact me on</p>
      <p>Facebook : https://www.facebook.com/huutoan02</p>
      <p>Github : https://github.com/huutoan02</p>
      <p>Source Code : https://github.com/huutoan02/ReactJS</p>
      <p>Instagram : https://www.instagram.com/htoan.js</p>
    </div>
  );
};

export default About;
